                    </li>
                    <li className='lista'>
                        <a>Mujer</a>
                    </li>
                </ul>
                <style jsx>
                    {`
                        .estilo{
                            width: 100%;
                            text-align: center;
                            margin-top: 3%;
                        }

                        .lista{
                            display:inline;
                        }
                    `}
                </style>
            </div>
        );
    }
}
